Entwined: Strings of Deception - Wendy99


Genre: Hidden Object | Puzzle


Uncover a dark scheme in Entwined: Strings of Deception and solve an elaborate 
murder mystery! Play the role of detective Karla Robbins and interview the different suspects of a grisly murder. Search the Edward family mansion and question the late Christopher Edward's wife, butler, housemaid, and even his physician in this incredible Hidden Object Puzzle Adventure game. Find the murderer and discover their motive in Entwined: Strings of Deception!


Interview suspects
Search Edward manor
Uncover a dark scheme!


System Requirements:


OS: Windows XP | Windows Vista | Windows 7
CPU: 1.6 GHz
RAM: 512 MB
DirectX: 9.0
Hard Drive: 503 MB


